import NavMenu from "../NavMenu/NavMenu";
import firebase from "../../utils/config";
import { useState } from "react";
import styles from "./ListFiles.module.css";
import CreateIcon from "@material-ui/icons/Create";
import DeleteForeverIcon from "@material-ui/icons/DeleteForever";
import Modal from "../Modal/Modal";
import today from "../../utils/dateUtils";
import jsPDF from 'jspdf';

function ListFiles(props) {
  const [sortDate, setSortDate] = useState(today);
  const [sortNurse, setSortNurse] = useState("");
  const [isChange, setIsChange] = useState(false);
  const [showModal, setShowModal] = useState(false);
  const [currentClient, setCurrentClient] = useState({});
  const change = () => setIsChange(!isChange);
  const clientList = props.useClients(sortDate, sortNurse, isChange);
  const openModal = () => setShowModal(!showModal);

  const toPdf=(props)=>{

    var doc = new jsPDF('p','pt','letter');
    var font = '';

    doc.addFileToVFS('Calibri Regular-normal.ttf', font);
    doc.addFont('Calibri Regular-normal.ttf', 'Calibri Regular', 'normal');
    var img = ' data:image/jpeg;base64,';
    doc.addImage(img, 'JPEG',0,0,600,800);

    doc.setFontSize(12);
    doc.setFont('Calibri Regular');
    doc.text(78,296,props.name);
    doc.text(78,340,props.street);
    doc.text(405,340,props.town);
    doc.text(335,435,props.email);
    doc.text(78,386,props.dateofbirth);
    doc.text(78,435,props.number);
    doc.text(405,386,props.oib);
    doc.text(405,250,props.dateoftesting);
    doc.save( props.name + '.pdf');

  }

  const deleteClients = (props) => {
    firebase
      .firestore()
      .collection("clients")
      .doc(props.id)
      .delete()
      .catch((e) => {
        alert("Neto je polo po zlu");
      });
    setIsChange(!isChange);
  };
  const updateClients = (props) => {
    setCurrentClient(props);
    openModal();
  };

  return (
    <div>
      <meta name="viewport" content="width=device-width, initial-scale=1"></meta>
      <NavMenu></NavMenu>
      <Modal
        showModal={showModal}
        setShowModal={setShowModal}
        currentClient={currentClient}
        isChange={change}
      ></Modal>
      <div className={styles.datePicker}>
        <label>Sortiraj po datumu: </label>
        <input
          name="sortingDate"
          type="date"
          defaultValue={today}
          onChange={(e) => setSortDate(e.target.value)}
        ></input>
        <label> Sortiraj po provoditelju: </label>
        <select
          name="nurse"
          className={styles.form}
          onChange={(e) => setSortNurse(e.target.value)}
        >
          <option value="">Odaberi provoditelja</option>
          <option value="M">M</option>
          <option value="S">S</option>
          <option value="R">R</option>
          <option value="J">J</option>
          <option value="Ivan Male">Ivan Male</option>
        </select>
      </div>
      <div className ={styles.tableDiv}>
        <table className={styles.responsivetable}>
          <thead>
            <tr>
              <th>RB</th>
              <th>Ime i prezime</th>
              <th>Datum roenja</th>
              <th>OIB</th>
              <th>Broj telefona</th>
              <th>Email</th>
              <th>Ulica</th>
              <th>Grad</th>
              <th>Vrsta testiranja</th>
              <th>Jezik</th>
              <th>Datum testiranja</th>
              <th>Vrsta rauna</th>
              <th>Cijena</th>
              <th>Posebne napomene</th>
              <th>Provoditelj</th>
              <th>Preferirano vrijeme</th>
              <th>Uredi</th>
            </tr>
          </thead>
          <tbody>
            {Object.keys(clientList).map((id) => {
              return (
                <tr key={id}>
                  <td data-label="RB">{clientList[id].rb}</td>
                  <td data-label="Ime i prezime">{clientList[id].name}</td>
                  <td data-label="Datum roenja">
                    {clientList[id].dateofbirth}
                  </td>
                  <td data-label="OIB">{clientList[id].oib}</td>
                  <td data-label="Broj mobitela">{clientList[id].number}</td>
                  <td data-label="Email">{clientList[id].email}</td>
                  <td data-label="Ulica">{clientList[id].street}</td>
                  <td data-label="Grad">{clientList[id].town}</td>
                  <td data-label="Vrsta testiranja">
                    {clientList[id].typeoftesting}
                  </td>
                  <td data-label="Jezik">{clientList[id].language}</td>
                  <td data-label="Datum testiranja">
                    {clientList[id].dateoftesting}
                  </td>
                  <td data-label="Vrsta rauna">{clientList[id].typeofbill}</td>
                  <td data-label="Cijena">{clientList[id].price}</td>
                  <td data-label="Posebne napomene">
                    {clientList[id].special}
                  </td>
                  <td data-label="Provoditelj">{clientList[id].nurse}</td>
                  <td data-label="Preferirano vrijeme">{clientList[id].prefTime}</td>
                  <td>
                    <button>
                      <i>
                        <CreateIcon
                          onClick={() => updateClients(clientList[id])}
                        />
                      </i>
                    </button>

                    <button
                      onClick={() => {
                        if (
                          window.confirm(
                            "Are you sure you wish to delete this item?"
                          )
                        )
                          deleteClients(clientList[id]);
                      }}
                    >
                      <i>
                        <DeleteForeverIcon />
                      </i>
                    </button>
                    <button onClick = {()=>toPdf(clientList[id])}>pdf</button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default ListFiles;
